import "../Styles/Home.css";
import img1 from "../Img/welcome.png";

function Home() {
    return (
      <div className="home">
        <img src={img1} alt="welcome to pdx" />
        <p className="home_intro"></p>
      </div>
    );
  }

export default Home;
